                </form>
                <style jsx>
                    {`
                        form{
                            border: 1px solid var(--accent-color);
                            border-radius:5px;
                            background-color: rgba(255,255,255, 0.2);
                            display: flex;
                            flex-direction: column;
                            justify-content: center;
                            align-items: center;
                        }

                        input, textarea{
                            border: none;
                            text-align:center;
                            padding-top: 0.5rem;
